import React from "react";
import { styled } from "styled-components";
import WorkItem from "../components/WorkItem";

const Wrapper = styled.section`
  > h2 {
    text-align: center;
    font-size: 50px;
    padding: 50px 0;
  }
`;
const WorkContent = styled.div`
  display: flex;
  padding: 60px;
  > h2 {
    text-align: center;
    border-bottom: 1px solid black;
  }
`;
const Text = styled.div`
  width: 40%;
  > h3 {
    font-size: 60px;
    margin-bottom: 30px;
  }
`;

const Website = styled.div``;

const Work = ({ title, url, img, text }) => {
  return (
    <Wrapper>
      <h2>WORK</h2>
      <WorkContent>
        <Text>
          <Website>
            <WorkItem title={title} url={url} img={img} text={text} />
          </Website>
        </Text>
      </WorkContent>
    </Wrapper>
  );
};

export default Work;
